components:
- type: Label
  properties: {role: null, align: left, tooltip: '', border: '', foreground: '', visible: true,
    text: 'The autoencoder algorithm functions in the same way that the PCA algorithm
      does. It is a method of data analysis that we can use to capture the trends
      in the data. Autoencoders essentially encode your data and then decode it in
      a representation as close to the original data set as possible. We need to define
      a message space x which consists of the historical stock returns data set and
      a two dimensional latent space z of unknown variables to encode/decode the data.
      We will be using a form of autoencoder called a variational bayesian autoencoder
      that specifically captures the posterior probability of the data set (Kingma
      am Welling, 2013). Posterior probability is essentially a metric that takes
      in all of the posterior data (previous time data) and provides a distribution
      for the current time period based on the posterior data. The underlying distribution
      for this autoencoder will be assumed to be normal. This normal distribution
      is then approximated to the 2D latent space by optimization of a log based evidence
      lower bound. ', font_size: null, font: '', spacing_above: small, icon_align: left,
    spacing_below: small, italic: false, background: '', bold: false, underline: false,
    icon: ''}
  name: label_1
  layout_properties: {grid_position: 'SWGLNP,CVPWPG'}
  event_bindings: {}
- type: Label
  properties: {role: null, align: center, tooltip: '', border: '', foreground: '',
    visible: true, text: 'Equation 1: logP(X) = DKL(Q||P)+L(Q)', font_size: null,
    font: '', spacing_above: large, icon_align: left, spacing_below: none, italic: false,
    background: '', bold: true, underline: false, icon: ''}
  name: label_3
  layout_properties: {grid_position: 'VOWZEE,GRJPDZ'}
- type: Label
  properties: {role: null, align: left, tooltip: '', border: '', foreground: '', visible: true,
    text: 'Equation 1 is defined above where P(X) is a fixed value with respect to
      Q, the D function represents the difference between the two spaces, and L(Q)
      is the evidence lower bound. The autoencoder maximizes this lower bound, which
      minimizes the difference between the two spaces. The algorithm will be run until
      this lower bound converges to a maximum value, approximately 200 iterations.
      Then a min difference and a max difference portfolio of ten stocks each will
      be selected based on the euclidean distance between the actual data and the
      generated latent space data. ', font_size: null, font: '', spacing_above: none,
    icon_align: left, spacing_below: small, italic: false, background: '', bold: false,
    underline: false, icon: ''}
  name: label_2
  layout_properties: {grid_position: 'AATFMO,SLPQWD'}
